import React from 'react';
import './App.css';
import { Route, Redirect } from 'react-router-dom';
import Home from './components/Home';

function App() {
  return (
    <div className="App">

      <Route path="/" activeClassName="active_class" exact component={() => {
        <Home name="about us" />
      }} > Home </Route>
      <Route path="/about" activeClassName="active_class" exact > About </Route>
      <Route path="/services" activeClassName="active_class" exact > Services </Route>
      <Route path="/contact" activeClassName="active_class" exact > Contact </Route>
      <Redirect path='/error'></Redirect>

    </div>
  );
}

export default App;
